import React from 'react';

const Background = ({ children }) => {
    return (
        <div style={{
            minHeight: '100vh',
            background: 'linear-gradient(135deg, #1e3a8a 0%, #7c3aed 50%, #3730a3 100%)',
            position: 'relative',
            overflow: 'hidden'
        }}>
            {/* Animated background elements */}
            <div style={{ position: 'absolute', inset: 0 }}>
                <div style={{
                    position: 'absolute',
                    top: '80px',
                    left: '40px',
                    width: '288px',
                    height: '288px',
                    background: 'rgba(59, 130, 246, 0.2)',
                    borderRadius: '50%',
                    filter: 'blur(60px)',
                    animation: 'pulse 3s ease-in-out infinite'
                }}></div>
                <div style={{
                    position: 'absolute',
                    top: '160px',
                    right: '40px',
                    width: '288px',
                    height: '288px',
                    background: 'rgba(147, 51, 234, 0.2)',
                    borderRadius: '50%',
                    filter: 'blur(60px)',
                    animation: 'pulse 3s ease-in-out infinite',
                    animationDelay: '1s'
                }}></div>
                <div style={{
                    position: 'absolute',
                    bottom: '80px',
                    left: '50%',
                    transform: 'translateX(-50%)',
                    width: '320px',
                    height: '320px',
                    background: 'rgba(236, 72, 153, 0.2)',
                    borderRadius: '50%',
                    filter: 'blur(60px)',
                    animation: 'pulse 3s ease-in-out infinite',
                    animationDelay: '2s'
                }}></div>
            </div>

            {/* Geometric patterns */}
            <div style={{ position: 'absolute', inset: 0, opacity: 0.1 }}>
                <div style={{
                    position: 'absolute',
                    top: '25%',
                    left: '25%',
                    width: '8px',
                    height: '8px',
                    background: 'white',
                    borderRadius: '50%',
                    animation: 'ping 2s cubic-bezier(0, 0, 0.2, 1) infinite'
                }}></div>
                <div style={{
                    position: 'absolute',
                    top: '75%',
                    right: '25%',
                    width: '4px',
                    height: '4px',
                    background: 'white',
                    borderRadius: '50%',
                    animation: 'ping 2s cubic-bezier(0, 0, 0.2, 1) infinite',
                    animationDelay: '0.5s'
                }}></div>
                <div style={{
                    position: 'absolute',
                    top: '50%',
                    left: '75%',
                    width: '12px',
                    height: '12px',
                    background: 'white',
                    borderRadius: '50%',
                    animation: 'ping 2s cubic-bezier(0, 0, 0.2, 1) infinite',
                    animationDelay: '1s'
                }}></div>
            </div>

            {/* Top Menu Bar */}
            <nav style={{
                position: 'relative',
                zIndex: 10,
                background: 'rgba(255, 255, 255, 0.1)',
                backdropFilter: 'blur(20px)',
                borderBottom: '1px solid rgba(255, 255, 255, 0.2)'
            }}>
                <div style={{
                    maxWidth: '1200px',
                    margin: '0 auto',
                    padding: '16px 24px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'space-between'
                }}>
                    {/* Logo */}
                    <div style={{ display: 'flex', alignItems: 'center', gap: '12px' }}>
                        <div style={{
                            width: '40px',
                            height: '40px',
                            background: 'linear-gradient(135deg, #60a5fa, #a855f7)',
                            borderRadius: '8px',
                            display: 'flex',
                            alignItems: 'center',
                            justifyContent: 'center',
                            boxShadow: '0 10px 15px -3px rgba(0, 0, 0, 0.1)'
                        }}>
                            <svg width="24" height="24" fill="none" stroke="white" viewBox="0 0 24 24">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M13 10V3L4 14h7v7l9-11h-7z" />
                            </svg>
                        </div>
                        <div>
                            <h1 style={{ fontSize: '20px', fontWeight: 'bold', color: 'white', margin: 0 }}>AppName</h1>
                            <p style={{ fontSize: '12px', color: 'rgba(255, 255, 255, 0.7)', margin: 0 }}>Your Digital Solution</p>
                        </div>
                    </div>

                    {/* Menu Items */}
                    <div style={{ display: 'flex', alignItems: 'center', gap: '32px' }}>
                        <a href="#" style={{ color: 'rgba(255, 255, 255, 0.8)', textDecoration: 'none', fontSize: '14px', fontWeight: '500', transition: 'color 0.3s' }}>Home</a>
                        <a href="#" style={{ color: 'rgba(255, 255, 255, 0.8)', textDecoration: 'none', fontSize: '14px', fontWeight: '500', transition: 'color 0.3s' }}>About</a>
                        <a href="#" style={{ color: 'rgba(255, 255, 255, 0.8)', textDecoration: 'none', fontSize: '14px', fontWeight: '500', transition: 'color 0.3s' }}>Services</a>
                        <a href="#" style={{ color: 'rgba(255, 255, 255, 0.8)', textDecoration: 'none', fontSize: '14px', fontWeight: '500', transition: 'color 0.3s' }}>Contact</a>
                    </div>

                    {/* Right side info */}
                    <div style={{ display: 'flex', alignItems: 'center', gap: '16px' }}>
                        <div style={{ textAlign: 'right' }}>
                            <p style={{ color: 'white', fontSize: '14px', fontWeight: '600', margin: 0 }}>24/7 Support</p>
                            <p style={{ color: 'rgba(255, 255, 255, 0.7)', fontSize: '12px', margin: 0 }}>+1 (555) 123-4567</p>
                        </div>
                        <div style={{
                            width: '32px',
                            height: '32px',
                            background: 'rgba(255, 255, 255, 0.2)',
                            borderRadius: '50%',
                            display: 'flex',
                            alignItems: 'center',
                            justifyContent: 'center'
                        }}>
                            <svg width="16" height="16" fill="none" stroke="white" viewBox="0 0 24 24">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 5a2 2 0 012-2h3.28a1 1 0 01.948.684l1.498 4.493a1 1 0 01-.502 1.21l-2.257 1.13a11.042 11.042 0 005.516 5.516l1.13-2.257a1 1 0 011.21-.502l4.493 1.498a1 1 0 01.684.949V19a2 2 0 01-2 2h-1C9.716 21 3 14.284 3 6V5z" />
                            </svg>
                        </div>
                    </div>
                </div>
            </nav>

            {/* Main Content Area */}
            <div style={{
                position: 'relative',
                zIndex: 10,
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                minHeight: 'calc(100vh - 80px)',
                padding: '48px 24px'
            }}>
                <div style={{ width: '100%', maxWidth: '480px' }}>
                    {/* Glass morphism container */}
                    <div style={{
                        background: 'rgba(255, 255, 255, 0.05)',
                        backdropFilter: 'blur(20px)',
                        borderRadius: '16px',
                        border: '1px solid rgba(255, 255, 255, 0.2)',
                        boxShadow: '0 25px 50px -12px rgba(0, 0, 0, 0.25)',
                        padding: '8px'
                    }}>
                        {children}
                    </div>
                </div>
            </div>

            {/* Bottom decorative elements */}
            <div style={{
                position: 'absolute',
                bottom: 0,
                left: 0,
                right: 0,
                height: '128px',
                background: 'linear-gradient(to top, rgba(0, 0, 0, 0.2), transparent)',
                pointerEvents: 'none'
            }}></div>

            {/* Floating particles */}
            <div style={{ position: 'absolute', inset: 0, overflow: 'hidden', pointerEvents: 'none' }}>
                <div style={{
                    position: 'absolute',
                    top: '25%',
                    left: '20%',
                    width: '16px',
                    height: '16px',
                    background: 'rgba(255, 255, 255, 0.2)',
                    borderRadius: '50%',
                    animation: 'float-slow 6s ease-in-out infinite'
                }}></div>
                <div style={{
                    position: 'absolute',
                    top: '33%',
                    right: '25%',
                    width: '8px',
                    height: '8px',
                    background: 'rgba(255, 255, 255, 0.3)',
                    borderRadius: '50%',
                    animation: 'float-medium 4s ease-in-out infinite'
                }}></div>
                <div style={{
                    position: 'absolute',
                    top: '66%',
                    left: '33%',
                    width: '12px',
                    height: '12px',
                    background: 'rgba(255, 255, 255, 0.1)',
                    borderRadius: '50%',
                    animation: 'float-fast 3s ease-in-out infinite'
                }}></div>
                <div style={{
                    position: 'absolute',
                    bottom: '25%',
                    right: '20%',
                    width: '20px',
                    height: '20px',
                    background: 'rgba(255, 255, 255, 0.15)',
                    borderRadius: '50%',
                    animation: 'float-slow 6s ease-in-out infinite',
                    animationDelay: '1s'
                }}></div>
            </div>

            {/* CSS Animations */}
            <style>{`
        @keyframes pulse {
          0%, 100% { opacity: 0.2; }
          50% { opacity: 0.4; }
        }
        
        @keyframes ping {
          75%, 100% {
            transform: scale(2);
            opacity: 0;
          }
        }
        
        @keyframes float-slow {
          0%, 100% { 
            transform: translateY(0px) rotate(0deg); 
          }
          50% { 
            transform: translateY(-20px) rotate(180deg); 
          }
        }
        
        @keyframes float-medium {
          0%, 100% { 
            transform: translateY(0px) rotate(0deg); 
          }
          50% { 
            transform: translateY(-15px) rotate(90deg); 
          }
        }
        
        @keyframes float-fast {
          0%, 100% { 
            transform: translateY(0px) rotate(0deg); 
          }
          50% { 
            transform: translateY(-10px) rotate(270deg); 
          }
        }

        /* Responsive design */
        @media (max-width: 768px) {
          nav > div {
            padding: 12px 16px;
          }
          
          nav > div > div:nth-child(2) {
            display: none;
          }
          
          nav > div > div:nth-child(3) > div:first-child {
            display: none;
          }
        }
      `}</style>
        </div>
    );
};

export default Background;
